import React, {Component} from  'react';
import FilterButton from "../filter-button/filter-button";
import './task-filter.css';

export default class TaskFilter extends Component {


    render() {
        return (
            <ul className='filters'>
                <li><FilterButton onClick={changeFilter} className='selected' label='All'/></li>
                <li><FilterButton onClick={changeFilter} label='Active'/></li>
                <li><FilterButton onClick={changeFilter} label='Competed'/></li>
            </ul>
        );
    }

}
